description:
Cliff Morgan: A Lifetime of Achievement

Biography Documentary hosted by Desmond Lynam, published by BBC in 2007 - English narration


Information
------------------------------

Cliff Morgan's rugby playing ability was legendary, his broadcasting voice unforgettable. From the mining village of Trebanog to the hard-playing fields of South Africa, from the Barbarians v the All Blacks to royal state occasions and beyond - Desmond Lynam leads the all-star tributes to this extraordinary man.

